import numpy as np

def simplify_maze(maze):
    # Convert the maze to a NumPy array for easier manipulation
    maze = np.array(maze)

    # Remove horizontal redundancies
    simplified_rows = [maze[0]]
    for row in maze[1:]:
        if not np.array_equal(row, simplified_rows[-1]):
            simplified_rows.append(row)

    maze = np.array(simplified_rows)

    # Transpose to work on columns as rows
    maze = maze.T

    # Remove vertical redundancies
    simplified_cols = [maze[0]]
    for col in maze[1:]:
        if not np.array_equal(col, simplified_cols[-1]):
            simplified_cols.append(col)

    # Transpose back to the original orientation
    simplified_maze = np.array(simplified_cols).T

    return simplified_maze.tolist()

